import { Carousel } from "react-carousel-minimal"
const Banner =()=>{
    const data = [
        {
            image: 'http://localhost:3000/image/iphone13banner.png',
            caption: 'Iphone13'
        },
        {
            image: 'http://localhost:3000/Image/samsungflipbanner.webp',
            caption:'z-flip'
        },
        {
            image: 'http://localhost:3000//Image/samsungfoldbanner.webp',
            caption:'zfold'
        }


    ];





    return(
        <Carousel data={data} time={8000} automatic={true}   dots={true} pauseIconColor="white" pauseIconSize="40px" slideImageFit="cover"
        
     />

    )

}
export default Banner
